script: |
  super -f text -I q3333.spq | sort > q3333.out

inputs:
  - name: q3333.spq
    data: |
      SELECT col2 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE col1 * - + 24 * + CAST ( NULL AS INTEGER ) NOT IN ( + - ( col1 ) / - - CAST ( + col0 AS INTEGER ) - + - col0 );
  - name: tab2

outputs:
  - name: q3333.out
    data: |
